    state = {
        currency: 'USD'
    }
    render() {
        console.log("props in prices", this.props)
        return (
            <div>
                <ul>
                    <li>Bitcoin rate for: {this.props.bpi.USD.description} :
                    <span>{this.props.bpi.USD.code}</span>
                        <strong>{this.props.bpi.rate}</strong>
                    </li>
                </ul>
            </div>
        )
    }
}

export default Prices
